import forms from "./formEntrance.json";

export function getName() {
  return forms.map((form) => {
    return (
      <form>
        <label for={form.id}> {form.name} </label>
        <br></br>
        <input
          type={form.type}
          placeholder={form.placeholder}
          id={form.id}
          name={form.name}
        />
        <select id={form.id} name={form.name}>
          <option value={form.value}>استقلال</option>
          <option value={form.value}>پرسپولیس</option>
          <option value={form.value}>دیگر تیم ها</option>
        </select>
      </form>
    );
  });
}
